import React, {Fragment} from 'react';

 const TodoApp = (props) => {
    const {titl, i, des} = props.todo;
    return (
        <Fragment>
                 <article>
                    <div>
                    <h2>{titl}</h2>
                     <p>{i}</p>
                     <p>{des}</p>
                    </div>
                    <div>
                        <button>
                            <i className='fa fa-trash fa-2x'></i>
                        </button>
                    </div>
                 </article>
             </Fragment>
    );
};
export default TodoApp;
